import { Component } from "react";

export class Form extends Component {
  state = {
    name: "",
    email: "",
  };

  handleChangeEvent = (event) => {};
  render() {
    return (
      <form>
        <label>
          <input
            type="text"
            name="name"
            placeholder="name"
            onChange={this.handleNameChange}
            value={this.state.name}
          />
        </label>

        <label>
          <input
            type="text"
            name="email"
            placeholder="email"
            onChange={this.handleEmailChange}
            value={this.state.email}
          />
        </label>
      </form>
    );
  }
}
